
drop table if exists managers cascade;
drop table if exists applicants cascade;
drop table if exists airplanes cascade;
drop table if exists specs cascade;
drop table if exists photos cascade;

create table managers
(
    manager_id int,
    username varchar(50) not null,
    password varchar(50) not null,
    email varchar(50) not null,
    state varchar(20) not null
);

create unique index manager_manager_id_uindex
    on managers (manager_id);

create unique index manager_password_uindex
    on managers (password);

create unique index manager_username_uindex
    on managers (username);

alter table managers
    add constraint manager_pk
        primary key (manager_id);

create unique index managers_email_uindex
    on managers (email);



alter table managers modify manager_id int auto_increment;

