create table airplanes
(
    airplane_id int,
    airplane_name varchar(100) not null,
    airplane_specs_id int not null,
    airplane_description varchar(2048) not null,
    airplane_photo_id int not null,
    airplane_type varchar(30) not null
);

create unique index airplane_airplane_id_uindex
    on airplanes (airplane_id);

create unique index airplane_airplane_name_uindex
    on airplanes (airplane_name);

alter table airplanes
    add constraint airplane_pk
        primary key (airplane_id);

alter table airplanes modify airplane_id int auto_increment;

